Dzikowo () is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Barlinek"&gt;Gmina Barlinek&lt;/a&gt;, within &lt;a href="My%C5%9Blib%C3%B3rz%20County"&gt;Myślibórz County&lt;/a&gt;, &lt;a href="West%20Pomeranian%20Voivodeship"&gt;West Pomeranian Voivodeship&lt;/a&gt;, in north-western Poland. It lies approximately west of &lt;a href="Barlinek"&gt;Barlinek&lt;/a&gt;, east of &lt;a href="My%C5%9Blib%C3%B3rz"&gt;Myślibórz&lt;/a&gt;, and south-east of the regional capital &lt;a href="Szczecin"&gt;Szczecin&lt;/a&gt;.
